// SPDX-License-Identifier: MIT
// OpenZeppelin Contracts v4.3.2 (utils/MosaicoERC20.sol)
pragma solidity ^0.8.9;

import "../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "../node_modules/@openzeppelin/contracts/security/Pausable.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";

//TODO: contract upgrades?
contract MosaicoERC20 is ERC20, Pausable, Ownable, ERC20Burnable {
    struct Settings {
        bool isMintable;
        bool isBurnable;
        string name;
        string symbol;
        uint256 initialSupply;
    }
    Settings internal _settings;

    constructor(Settings memory settings) 
        ERC20(settings.name, settings.symbol) 
        Ownable() 
        Pausable() 
    {
        _settings = settings;
        _mint(msg.sender, _settings.initialSupply);
    }

    function transfer(address to, uint256 value) public override whenNotPaused returns (bool) {
        return super.transfer(to, value);
    }

    function transferFrom(address from, address to, uint256 value) public override whenNotPaused returns (bool) {
        return super.transferFrom(from, to, value);
    }

    function pause() public onlyOwner {
        super._pause();
    }

    function unpause() public onlyOwner {
        super._unpause();
    }

    function mint(uint256 amount) public onlyOwner returns(bool success) {
        require(_settings.isMintable == true, "Contract was not configured to be mintable");
        super._mint(_msgSender(), amount);
        return true;
    }

    function burn(uint256 amount) public virtual override(ERC20Burnable) {
        require(_settings.isBurnable == true, "Contract was not configured to be burnable");
        super.burn(amount);
    }
}
